(11, 1, '2025-02-24 20:10:15', '2025-02-24 20:10:15', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"https://jelezo.by/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Главная страница', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2025-02-24 20:10:15', '2025-02-24 20:10:15', '', 2, 'https://jelezo.by/?p=11', 0, 'revision', '', 0),
