(24, 1, '2025-02-24 21:50:25', '2025-02-24 21:50:25', '<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p><blockquote><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</p></blockquote><p>...or something like this:</p><blockquote><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote><p>As a new WordPress user, you should go to <a href=\"https://jelezo.by/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>', 'Главная', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2025-02-24 21:50:25', '2025-02-24 21:50:25', '', 2, 'https://jelezo.by/?p=24', 0, 'revision', '', 0);

